commits.sourceNew:
/** Virtual frame, never pop */
Frame loadVirtualFrame(Frame frame) throws IOException {
  frame.fstArc.output = fstOutputs.getNoOutput();
  frame.fstArc.nextFinalOutput = fstOutputs.getNoOutput();
  frame.fsaState = -1;
  return frame;
}

